import React from 'react';
import product from './dataTest';

class ProductDetails extends React.Component {
  render() {
    const { title, price } = product.results[0];
    console.log(product);
    return (
      <div>
        <h1>{title}</h1>
        <h2>R$ {price}</h2>
      </div>
    );
  }
}

export default ProductDetails;
